import styles from "./Colors.module.css"

function Colors ({ func }) {
    function handleClick(color) {
        func(color);
    }

    return (
        <div className={styles.colors}>
            <div className={styles.circle} onClick={() => handleClick("green")}></div>
            <div className={styles.circle} onClick={() => handleClick("yellow")}></div>
            <div className={styles.circle} onClick={() => handleClick("orange")}></div>
            <div className={styles.circle} onClick={() => handleClick("red")}></div>
            <div className={styles.circle} onClick={() => handleClick("purple")}></div>
        </div>
    );
}

export default Colors;
